import './App.css';


function App() {
  return (
    <>
        <TodoTitle completed={16} total={25}/>
        <TodoSearch/>

        <TodoList> 
          <TodoItem />
          <TodoItem />
          <TodoItem />
        </TodoList>

        <CreateTodoButton/>
    </>
  );
}

function TodoItem(){
  return(
  <li>
    <span>V</span>
    <p>Cry with cry-baby</p>
    <span>X</span>
  </li>
  );
}







export default App;
